import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='pass'>
        <h2>Password Generator</h2>

        <div className='passbox'>
        <input type='text' readOnly /> <button>Copy</button>
      </div>

      <div className='passlength'>
        <label>Password length</label>
        <input type='number' max={20} placeholder='Digit'/>
      </div>

      <div className='passUpper'>
        <label>Include UpperCase Letter</label>
        <input type='Checkbox'/>
      </div>

      </div>


    </div>
  );
}

export default App;
